import ExpenseItem from "./Components/ExpenseItem";

function App() {

    const expenseProp = [
        {
            id: 1,
            title: "Gold Installment",
            amount: 15000,
            expenseDate: new Date(2021, 2, 28),
        },
        {
            id: 2,
            title: "Mutual Fund",
            amount: 10000,
            expenseDate: new Date(2021, 2, 28),
        }
    ];
    return (
        <div>
            <h2>Let's get started!</h2>
            <ExpenseItem title={expenseProp[0].title}
                         amount={expenseProp[0].amount}
                         expenseDate-={expenseProp[0].expenseDate}></ExpenseItem>
            <ExpenseItem title={expenseProp[1].title}
                         amount={expenseProp[1].amount}
                         expenseDate-={expenseProp[1].expenseDate}></ExpenseItem>
        </div>
    );
}

export default App;
